import React from "react";
import { Link } from "react-router-dom";

const Navigation = () => {
  return (
    <nav className="site-navigation">
      <span>Stalic"s blog</span>
      <ul>
        <Link>Home</Link>
      </ul>
    </nav>
  );
};

export default Navigation;
